function ajax(t){$.ajax({url:t,headers:{Accept:"application/vnd.github.html"}}).done(function(t){$("main").html('<div class="w-100 m-0 p-4">'+t+"</div>")})}function router(t){let e=window.location.href.split(window.location.origin)[1];return!!route[e]&&($("main").html('<div class="text-center text-white bg-primary rounded fs-5 m-4 p-4">Loading...</div>'),t.preventDefault(),ajax(route[e]))}window.addEventListener("load",router),window.addEventListener("hashchange",router);
